import React from "react";
import { Background, GenericMessage, NavBar } from "../../Components/index";
import "./GenericPage.scss";
function GenericPage() {
  return (
    <>
      <Background rightLeaves leftLeaves rightScratched>
        <NavBar />
        <GenericMessage />
      </Background>
    </>
  );
}

export default GenericPage;
